import React from "react";
import data from "../data"

export default function List(){
    return(
        <div className="mt-5 bg-">
            {data.map(itm => {
                return(
                    <div key={itm.id}>
                        <h3>{itm.title}</h3>
                        <p>{itm.content}</p>
                    </div>
                )
            })}
        </div>
    )
}
